import React from 'react'

const Project = (props) => {
    return (
        <div>
             <div className="portfolio-container">
          <a href="http://"><img  className="portfolio-container-img" src={props.image} alt="hello" /></a>
         <div className="portfolio-right">
             <p> <span>Discription</span>: {props.discription}
             </p>
             <p> github : {props.github }</p>
         </div>


         </div>
        </div>
    )
}

export default Project;
